استمع لهذا التسجيل الصوتي (باللهجة المصرية العامية).استخرج منه بيانات المصروفات.
المطلوب:1. amount: المبلغ (رقم فقط).2. item: البند (ماذا اشتريت؟).3. category: التصنيف.
ملاحظة: إذا قال المستخدم "خمسين جنيه"، حولها لرقم 50.الرد بصيغة JSON فقط:{ "amount": 0, "item": "", "category": "" }

استخرج بيانات المصروفات من النص التالي:"{{1.message.text}}"
المطلوب استخراجه:1. amount: المبلغ (رقم فقط).2. item: البند (اسم السلعة أو الخدمة).3. category: التصنيف (طعام، مواصلات، فواتير، ترفيه، أخرى).
تعليمات صارمة:- رد بصيغة JSON فقط.- لا تستخدم `markdown` أو علامات ```json.- الصيغة المطلوبة:{ "amount": 0, "item": "string", "category": "string" }
